Defendant Gregory T Williams in court with attorney Thomas E Harris.  Defendant Gregory T Williams in custody.  Miriam S Falk appeared for the State of Wisconsin.
Deputy court clerk ccp.
Case set for sentencing hearing. Branch 25 kept this matter that was spun to this court from Branch 10 on 05/05/2014. Statements made as to sentencing. Additional statements made by Cyrena M. and Regina B. 

As to COUNT 1 as AMENDED-  
Court ordered defendant to serve 90 DAYS in the House of Correction consecutive to any sentence; straight time; credit for 90 days time served, a TIME SERVED DISPOSITION.

As to COUNT 2-
Court ordered defendant to serve 5 MONTHS in the House of Correction, straight time; consecutive to COUNT 3; Court ordered the DOC to determine how many days of credit are remaining after the credit on time served disposition on count 1 and apply that remaining amount to the sentence in COUNT 2. Court will allow defendant to participate in work training programs at the HOC.

As to COUNT 3-
Court ordered defendant to serve 7 MONTHS in the House of Correction, straight time; consecutive to COUNT 2; 

Court STAYED the sentence on COUNT 3 and placed defendant on probation for 2 YEARS. Probation period is to commence after serving sentence on COUNT 2. 

Conditions of probation as follows:
1) If defendant does not participate in sex offender treatment, he is to participate in a program for healthy relationship counseling;
2) Attend parenting class;
3) AODA assessment and comply with any treatment;
4) Maintain absolute sobriety;
5) If defendant has a prescription, he is to report it to agent;
6) No contact with Tonisha B., Reginald B., Phyllis A.;
7) Provide DNA sample and pay DNA surcharge on count 1. Court WAIVES DNA surcharge on COUNTS 2 & 3 as they arise from the same incident;
8) Pay all costs, fees and surcharges. Failure to pay will result in a civil judgment. Court will allow defendant to enter in a payment plan;
9) Complete 50 hours of community service at a non-profit organization with the agents approval WITHIN the first 6 months of probation;
10) Participate in vocational training. If not in vocational training, defendant is to obtain employment on-the-books with at least 30 hours per week. 

If defendant is revoked from probation and is employed at the time of revocation, defendant can have release for work.

Appellate rights notice given to the defendant. 
